            '* 이 제품에 대한 세부정보를 알리고자 청소시작영상, 청소진행영상, 충전복귀영상을 나누어 찍어놨는데, 영상이 올라가지 않아 부득이 사진만 올려둡니다.\n\n\n0. 기존 제품 사용 간단 후기 + 구매동기\n로봇청소기는 5년 전 LG사 제품을 2년간 사용하다가 장모님댁에서 필요하다 하셔서 드리고(새제품을 사드리고 싶었으나, 그 당시 가격압박이;;), 2년 전에 샤오미 제품을 구매하여 사용하고 있습니다. 제가 구매한 샤오미 제품은 중저가형이었는데, 전반적으로 흡입력이 약하고 물청소가 잘 안 된다는 게 단점이었습니다. 게다가 배터리 성능 및 흡입력이 현저하게 떨어져, 1주일에 한 번은 유선 진공청소기로 청소를 해왔는데요. 지난 주 헬스PT를 받다가 허리 디스크 상태가 악화되어 고심 끝에 새제품으로 바꾸기로 결심하였습니다. \n\n사실, 클리엔은 3달 전에 친구로부터 추천받은 브랜드였는데요. 당시 그 친구는 R9 제품을 갖고 있었는데, 만족도가 매우 높다며 클리엔 제품을 강력추천하더군요. 그래서 클리엔 제품을 구매하기로 결정하였고, T24와 R9 두 제품 중 저울질을 거듭하다 결국 가격문제 때문에 R9 제품으로 구매하게 되었습니다. \n\n\n1. 배송\n톡딜 종료 후 하루만에 배송이 되었습니다. 전북 지역에 거주 중인데, 지방임을 감안해볼 때 배송은 상당히 빠르게 진행되는 것 같았습니다.\n\n2. 언박싱\n배송완료 문자를 받고, 설레는 마음으로 집에 일찍 귀가하였습니다. 배송중 제품이 상하지 않게끔 꼼꼼하게 포장해주신 흔적이 역력했습니다.\n\n박스를 뜯고 제품 구성품을 하나하나 살펴보았는데, 특허받았다는 분섬사 물걸레 패드도 넉넉히 들어 있었고, 물통, 먼지통, 2in1(물통+먼지통) 구성품 모두 장착하는 데 어려움이 없었습니다. 로봇청소기는 어르신들 선물로도 많이 한다고 하는데, 어르신들이 비교적 쉽게 제품 구성품을 장착하고 분해하실 것 같습니다.\n\n첫 청소를 위해 사이드브러시와 2in1을 장착하였습니다. 와이파이 연결도 시도했는데요. 제 착오로 인해 2번 정도 오류를 경험한 것 빼고는 큰 불편함 없이 잘 연결할 수 있었습니다.\n\n  * 와이파이 연결하실 때, 와이파이 5g 혹은 &#39;모바일 데이터&#39;에 자동연결되지 않도록 유의하셔야 합니다. 그것만 아니면 와이파이 연결이 매끄럽게 됩니다\n\n\n3. 청소 능력(소음 정도 포함)\n청소 능력은 가히 훌륭합니다. 개인적으로는 네 가지 부분이 매우 만족스러웠는데요.\n\n첫째, 청소모드\n이 제품은 앱을 통해서 Y형 청소모드, 지그재그 청소모드를 자유롭게 선택할 수 있는데요. 저는 성능 체크를 위해 두 가지 모드를 다 활용해봤습니다.\n\n지그재그 청소모드는 예전에 썼던 LG사와 샤오미사 제품의 기본모드에 해당되는데, 그 제품들보다 전반적으로 기민하게 움직이는 것으로 보였습니다. 센서 능력이 출중해서인지, 거실 및 바닥에 놓인 장애물들을 잘 인지하고 회피하더군요. \n\n개인적으로는 Y형 청소모드가 궁금했는데요. 이미지에서 확인되는 바, 지그재그 모드보다 훨씬 꼼꼼하게 청소한다는 느낌을 받았습니다. 특별한 일이 없는 한, 평소에는 Y형 청소모드로 설정하고 쓸 것 같습니다.\n\n둘째, 흡입력 자동 변환\n제가 놀랐던 것은 일반 거실 바닥에서는 1단계의 흡입력을 보이다가, 카펫으로 올라가면 자동으로 3단계의 흡입력으로 전환한다는 것이었습니다. 지그재그 모드, Y형 모드 모두에서 그런 성능을 보여줬는데요. 가정 내에 카펫이 있거나, 반려동물을 키우시는 분들에게는 특히 매력을 느낄 수 있을 만한 요소라고 보여집니다.\n\n셋째, 물걸레질 성능\n저는 2주에 한번씩 비쎌 스팀청소기를 활용하여 물걸레질을 해왔습니다. 스팀청소를 하신 분들은 아시겠지만, 청소를 마친 후 바닥은 정말 뽀송해지거든요. 솔직히 스팀청소만큼의 성능은 아니지만, 이 제품의 물걸레질 성능은 상당히 좋아보였습니다. 이게 제품 자체의 성능 때문인지, 아니면 특허받았다는 &#39;분섬사 물걸레 패드&#39;(설명서에 그렇게 써 있더군요) 때문인지는 모르겠습니다만, 체감상 스팀청소 했을 때의 그 뽀송함 정도의 80% 정도는 되는 듯했습니다. 아마도 이 제품 덕택에 2주에 한 번 정도 했던 스팀 청소를 한 두달에 한 번으로 줄일 수 있을 것 같습니다.\n\n넷째, 소음 정도\n소음측정기 어플을 다운받아 로봇청소기의 소음을 측정해보았는데요. 휴대폰 어플로 측정한 것이라 다소 정확성이 떨어질 수 있지만, 제가 측정한 평균값은 다음과 같았습니다.\n\n[흡입력 1단계]\n ㅡ 로봇청소기 바로 옆에서 측정한 값 : 58~65db\n ㅡ 로봇청소기 옆에 서서 측정한 값 : 51~55db\n\n[흡입력 3단계]\n ㅡ 로봇청소기 바로 옆에서 측정한 값 : 71~77db\n ㅡ 로봇청소기 옆에 서서 측정한 값 : 64~69db\n\n아파트 기준으로 놓고 볼 때, 흡입력 3단계는 저녁 시간에 돌리기에는 아래층 눈치가 보일 듯합니다. 그러나 1단계는 새벽 시간만 아니라면(새벽에는 너무 고요해서윗집 샤워하는 소리도 들린다는;;;), 아래층 눈치보지 않고 사용할 수 있을 것 같습니다.\n\n\n4. 마무리\n별점 5점 중에서 5점을 주고 싶을 정도로 만족스러운 제품입니다. 클리엔 앱 다운받아서 와이파이 연결할 때 버벅인 것(사실 이건 기계치에 가까운 내 탓이 큽니다ㅠ), 청소 중에 Y형 청소모드-지그재그 청소모드 변경할 경우, 청소가 중단되었다가 다시 시작한다는 것 등을 제외하고는 모든 면에서 만족스럽습니다. \n\n가성비 제품이라는 댓글도 보았는데, 저는 더 비싼 제품(제가 쓰던 LG, 샤오미 제품)보다 성능이 좋다는 느낌을 받았습니다. 물론 구매한 시점이 다르긴 하지만요.\n\n더 장시간 사용해보고 별문제가 없다면, 다음에도 클리엔 제품을 또 구매할 것 같습니다(그땐 클리엔 프리미엄 제품을 사야겠다는ㅎㅎ)\n\n* 참고로 클리엔 어플에 소모품 수명체크, 고장점검 서비스 등도 있었는데, 새제품이라 아직 사용은 못해봤어요. 추후 해당 서비스 이용시 장단점이 있으면 다시 후기 올리겠습니다.',
